    static class Solution_暴力 {
        Set<String> set = new HashSet<>();

        public boolean validTicTacToe(String[] board) {
            generateAllSolution("         ", 9, true);
            return set.contains(board[0] + board[1] + board[2]);
        }

        private void generateAllSolution(String current, int left, boolean isX) {
            // 终止条件：已有赢家或者枚举完成
            if (left == 0 || isWin(current)) {
                set.add(current);
                return;
            }
            set.add(current);
            char[] chars = current.toCharArray();
            // 不下该步
            generateAllSolution(current, left - 1, isX);
            // 下该步
            for (int index = 0; index < 9; index++) {
                if (chars[index] == 'X' || chars[index] == 'O') {
                    continue;
                }
                chars[index] = isX ? 'X' : 'O';
                generateAllSolution(new String(chars), left - 1, !isX);
                chars[index] = ' ';
            }
        }

        private boolean isWin(String current) {
            char[] chars = current.toCharArray();
            return (chars[0] == 'X' && chars[1] == 'X' && chars[2] == 'X') ||
                    (chars[0] == 'O' && chars[1] == 'O' && chars[2] == 'O') ||
                    (chars[3] == 'X' && chars[4] == 'X' && chars[5] == 'X') ||
                    (chars[3] == 'O' && chars[4] == 'O' && chars[5] == 'O') ||
                    (chars[6] == 'X' && chars[7] == 'X' && chars[8] == 'X') ||
                    (chars[6] == 'O' && chars[7] == 'O' && chars[8] == 'O') ||

                    (chars[0] == 'X' && chars[3] == 'X' && chars[6] == 'X') ||
                    (chars[0] == 'O' && chars[3] == 'O' && chars[6] == 'O') ||
                    (chars[1] == 'X' && chars[4] == 'X' && chars[7] == 'X') ||
                    (chars[1] == 'O' && chars[4] == 'O' && chars[7] == 'O') ||
                    (chars[2] == 'X' && chars[5] == 'X' && chars[8] == 'X') ||
                    (chars[2] == 'O' && chars[5] == 'O' && chars[8] == 'O') ||

                    (chars[0] == 'X' && chars[4] == 'X' && chars[8] == 'X') ||
                    (chars[0] == 'O' && chars[4] == 'O' && chars[8] == 'O') ||
                    (chars[2] == 'X' && chars[4] == 'X' && chars[6] == 'X') ||
                    (chars[2] == 'O' && chars[4] == 'O' && chars[6] == 'O');
        }
    }

